INSERT INTO `general_emails` VALUES (1,'register_email','Admin : One user has registered','<h4><span style=\"font-family: verdana, arial, helvetica, sans-serif; font-size: small;\">Hi , </span></h4>\n<p>One member has been registered in the lunchmatcher.com <br /> <br /> Name : #FULL_NAME# <br /> Email address : #EMAIL# <br /> Country : #COUNTRY# <br /> Work industry : #INDUSTRY# <br /> Experience level : #EXPERIENCE# <br /> <br /> <span style=\"font-family: verdana, arial, helvetica, sans-serif; font-size: small;\">Thanks,<br /> <br /> Lunch Matcher<br /><br /></span></p>','Lunch Matcher-  Register Success','Y'),(34,'register_email_touser','Welcome to LunchMatcher!','<h4><span style=\"font-family: verdana, arial, helvetica, sans-serif; font-size: small;\">Hi #FULL_NAME#, </span></h4>\n<div id=\"yui_3_16_0_1_1444540289785_15582\">We thank you for downloading our app and becoming one of the early adopters of this new networking concept!</div>\n<div id=\"yui_3_16_0_1_1444540289785_15583\">As the app is still new and we are working tirelessly to grow its local user base, you may not be receiving many networking matches at this point. We kindly ask you to be patient with us for a few weeks while we reach a critical mass which will enable a better user experience for all. We will promptly contact you once the app is in a better position for daily use.<br />&nbsp;</div>\n<div id=\"yui_3_16_0_1_1444540289785_15588\">You could also help us get there quicker by spreading the words amongst your friends and contacts, so each would then tell other and create a viral effect for the app to grow faster.<br /><br /><span>If you have any questions, comments, or suggestions regarding our website or app, please contact us at <a href=\"mailto:info@lunchmatcher.com\" target=\"_top\">info@lunchmatcher.com</a>.</span><br />&nbsp;</div>\n<div id=\"yui_3_16_0_1_1444540289785_15607\">Thank you once again and we hope to get back to you very shortly to start meeting new people over lunch!</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div id=\"yui_3_16_0_1_1444540289785_15589\">Regards,</div>\n<div>&nbsp;</div>\n<div id=\"yui_3_16_0_1_1444540289785_15606\">LunchMatcher team</div>\n<div id=\"yui_3_16_0_1_1444540289785_15592\"><span style=\"font-size: xx-small;\">Web:&nbsp;</span><a id=\"yui_3_16_0_1_1444540289785_15591\" href=\"http://www.lunchmatcher.com/\" rel=\"nofollow\" shape=\"rect\" target=\"_blank\"><span id=\"yui_3_16_0_1_1444540289785_15590\" style=\"font-size: xx-small;\">www.lunchmatcher.com</span></a></div>\n<div id=\"yui_3_16_0_1_1444540289785_15594\"><span style=\"font-size: xx-small;\">Facebook:&nbsp;</span><a id=\"yui_3_16_0_1_1444540289785_15593\" href=\"http://www.facebook.com/lunchmatcher\" rel=\"nofollow\" shape=\"rect\" target=\"_blank\"><span style=\"font-size: xx-small;\">www.facebook.com/lunchmatcher</span></a></div>\n<div id=\"yui_3_16_0_1_1444540289785_15597\"><span style=\"font-size: xx-small;\">LinkedIn:&nbsp;</span><a id=\"yui_3_16_0_1_1444540289785_15596\" href=\"http://www.linkedin.com/company/lunch-matcher\" rel=\"nofollow\" shape=\"rect\" target=\"_blank\"><span id=\"yui_3_16_0_1_1444540289785_15595\" style=\"font-size: xx-small;\">www.linkedin.com/company/lunch-matcher</span></a></div>\n<p><br /> <br /> &nbsp;</p>','Welcome to LunchMatcher!','Y');
